INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (194,'038','만리가 되는 먼길을 가야 하는데 가면 갈수록 높은 산이 가로막는 겁입니다. 일이 뜻대로 이루어지기가 쉽지 않으니 자지 자리를 옮기고 하던 일을 바꾸게 될 운입니다. 본처에는 마음이 산란하여 멍시 종적을 수가 없겠습니다. 그런 중에 서로 다툴게 되면 구설수를 면하기 어려울 것이니 주의하십시오. 미리 결정되지 않은 것이 많으니 마음이 쉽게 안정되지 않고 산란할 수밖에 없습니다. 수심이 떠나지 않으니 실행하면 차라리 낫을 것입니다. 머지않 오동잎이 날아져 버리니 보잘이 날아왔도 붙들지 못하고 다시 날아가겠습니다. 허모래가 깔린 백사장의 시냇물에 달빛이 비추기 시작하니 잘못하면 복을 입을지도 모르며 신변도 두려우니 주의하십시오.','굵은 산에 외로운 소나무가 홀로 서 있음과 같으며 큰 바다에 조각배가 떠있음입니다. 운수가 많이 거치게되니 반드시 손해가 있을 것인줄 주의해야 합니다. 신중하게 처신한다면 일의 정한 이치가 효이 변하여 길하게 될 것이니 염려치 마십시오.','자여 후욕이 두려우니 미리 욕을 면하려면 목욕 대찬에 가서 불공을 드리십시오. 상하가 마음을 합하지 못하고 각각이니 매사를 이루지 못하지 허둥거리게 됩니다.  사람을 잘못 사귀면 그로 인해 해를  입을 것이니 사람을 잘 사귀어야 합니다.','본처에는 방으로 소득이 없고 여름철에 가서야 뜻이 이루어지기 시작할 것입니다. 부측에 가면 반드시 실패할 것이니 그렇다고 아무 것도 하지 않음은 금물입니다. 비록 노력해서 도리어 공로가 없더라도 열심히 일을 해야만 할 것입니다.','벌들가지는 훨훨하고 복숭아꽃은 붉게 피었으니 가히 본처의 기운을 만났습니다. 몸과 마음이 태평하니 집안의 경사가 있겠으니 이보다 더 좋은 일이 있겠습니까? 재물이 밖에 있으니 출행하여 구하려고 노력하면 얻게 될 것입니다.','수심이 끊기지 않고 구설수가 끝까지 따라 다니니 마음을 정할 수가 없겠습니다.  토색하지 마십시오. 사소한 일로 다투면 그 일로 인해 구설수가 생길 것입니다. 사람을 구해주었으나 은인이 오히려 원수로 변하게 되니 이를 조심하십시오.','그대가 도왔줄 것이니 어찌 광명이 나타나지 않겠습니까. 곡이 날아지고 역마를 못지 않는다면 광형은 어찌하여 불어닥친 말입니까. 신수가 이 운수를 한턱만 하고 있겠습니까. 참을 수밖에 없습니다.','달 밝은 험한 산에서 두견새가 슬피 울고 있으니 처량하기 그지없습니다. 동방에 가지 마십시오. 반드시 손해가 있으며 새 일을 도모해서는 재미를 보지 못하겠습니다. 비록 재물을 얻긴 했으나 얻어서 반은 잃게 될 것입니다. 미리 대비하십시오.','비록 노력은 하나 수고로운 만큼 공이 없으니 어찌 한턱만  하고 있겠습니까. 만약 손재를 당하지 않으면 반드시 배우자를 잃거나 다툴게 될 것입니다. 손재한 것을 한턱만 하고 있으면 몸에 병이 침범할 것이니 내일을 위해 건강을 돌보십시오.','일이 뜻대로 되기가 쉽지 않으니 마음에 번민이 생김을 믿지 못하겠습니다. 하루밤 광형에 곡이 날아져서 어디로 다 가버렸는지라든 탄 비어 있습니다.  집안이 불안하고 위태하니 조상을 모셔 제사를 모시고 기도함이 좋을 것입니다.','노력을 아끼지 말고 힘껏 도전하십시오. 머지않 큰 재물을 얻을 수 있겠습니다. 동으로 달리고 서로 치달으니 잠시도 쉬지 못하고 바삐기만 한 것을 어찌 하겠습니까. 굵은 산이 무너가니 미래는 좋을 것입니다.','구름이 흩어지고 달이 옆귀를 내밀었으니 경치가 아름답고 새롭기만 합니다. 본 풀이 본을 만나 다시 자라남과 같으니 일취월장입니다. 실행하면 이득을 얻고 좋은 일이 있을 것이니 이는 필시 하늘이 준 복입니다.','기일을 잘  포착하여 도전하게 되면 반드시 작은 재물이라도 얻을 수 있습니다. 만약 시비를 가까이 한다면 송사가 두려우니 입을 조심하고 주의하십시오. 이왕은 김숙과 이숙이 줄 것이니 평소에 밉던 있게 말 인연일 것입니다.','2025-03-02 11:57:15.368032+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (407,'038','您必须走很长一段路才能成为一个男人，但是高山被阻止令人恐惧。根据遗嘱完成工作并不容易，因此我将改变工作。心脏在主办公室产生，所以我不能瘀伤。同时，如果您互相争论，很难避免古苏尔。有很多事情尚未提前确定，因此头脑不容易稳定和产卵。深度不会离开，因此，如果运行它，它将更好。 Paulownia离开飞走后，我将无法坚持下去。月光开始在白色沙滩的溪流上闪耀。','孤独的松树独自一人站在茂密的山上，雕塑漂浮在大海中。您应该小心，因为您的运气经历了很多。如果您小心，工作的确定原因将会改变，因此请不要担心。','我害怕害怕，因此，如果您想避免提前宣誓就职，请去洗澡，给它不公平。顶部和底部是统一的，每个都没有实现。  如果您是一个错误的人，您将受到伤害。','在地点，房间里将没有收入，并且将开始到夏天。如果您去部门方面，它将失败，因此禁止什么都不做。即使您尝试努力工作，您也必须努力工作。','蜜蜂要高得多，桃花朵是红色的，所以我遇到了主桥的能量。由于身心有和平，房子有一个斜坡，所以有比这更好的东西吗？财富在外面，因此，如果您试图下车并获得它，就会得到它。','深度不会破裂，并且水被跟随到最后，所以我无法决定自己的心。  不要转。如果您与琐碎的事情争论，它将导致古苏尔。小心那个男人，但是银变成敌人。','您怎么不出现，因为您会帮助您？如果这首歌在飞行，而不少于马，为什么会炸毁？ Shinsu只能有这个运气吗？我别无选择，只能忍受。','月亮是如此的悲伤，以至于鸟儿在崎the崎山上哭泣。不要去东方。有损失，您将没有乐趣寻求新工作。尽管我有钱，但我会得到一半的一半。请提前准备。','即使努力并不像艰难的努力一样，您该怎么做？如果您没有敏捷性，那么您一定会失去或与配偶打架。如果您要敏捷，您的身体会侵袭您的身体，因此请照顾明天的健康。','工作的预期并不容易，所以我不敢相信我的心脏困扰。一首晚上，这首歌在轻型中飞来飞去，我很空了。  一家人焦虑和危险，因此祈祷和祈祷会很好。','不要浪费努力，挑战。您可以在不久的将来获得大量财富。您如何做一些事情要忙碌而又不破裂并互相奔跑？厚山将掉下来，因此未来会良好。','乌云散布，月亮伸出月球的侧面，因此风景是美丽而新的。这与这个游泳池的相同并再次成长。如果您运行它，它将受益，有些东西会很好。','如果您很好地捕获日期并挑战日期，则甚至可以获得一笔小财富。如果您接近受精，那么您会害怕这首歌，因此请小心嘴。这位国王将由金·索克（Kim Sook）和李·索克（Lee Sook）提供。','2025-03-02 11:57:15.368032+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (478,'038','あなたは男になるために長い道のりを歩かなければなりませんが、高い山がブロックされているのは怖いです。意志に従って仕事をするのは簡単ではないので、仕事を変えます。心臓はメインオフィスで生まれているので、私はあざを作ることができません。それまでの間、お互いに議論した場合、ガスルを避けることは困難です。事前に決定されていないことがたくさんあるので、心は簡単に安定して生み出されません。深さは離れないので、実行するとそれが良くなります。ポールオーウンが去るとすぐに、私はそれを握ることができません。月明かりは、砂のある白い砂浜の小川で輝き始めます。','孤独な松の木は厚い山の中に一人で立っており、彫刻は大きな海に浮かんでいます。あなたの運が多くのことを経験するので、あなたはあなたが損傷を受けることに注意する必要があります。注意している場合、作業の決定的な理由は変わりますので、心配しないでください。','私は恐れることを恐れているので、事前に誓うことを避けたいなら、お風呂に行って不公平にしてください。上部と下部は団結しており、それぞれが満たされていません。  あなたが間違った人を作るなら、あなたはそれのために傷つきます。','場所の場所では、部屋に収入がなく、夏に来るようになります。部門側に行くと失敗するので、何もしないことは禁じられています。あなたが一生懸命働きようとしたとしても、あなたは一生懸命働かなければなりません。','ミツバチははるかに高く、桃の花は赤いので、私はメインブリッジのエネルギーに出会いました。体と心には平和があるので、家の斜面があるので、これよりも良いものはありますか？富は外にあるので、あなたが降りてそれを手に入れようとするなら、あなたはそれを手に入れます。','深さは壊れず、水は最後まで続いているので、心を決めることはできません。  向きを変えないでください。些細なことで議論すると、それはガスルにつながります。男性には注意してください。しかし、銀は敵に変わります。','あなたがあなたを助けるのでどうやって現れませんか？歌が飛んでいて、馬に劣らない場合、なぜ爆発するのですか？ shinsuはこの運のみを持っていますか？耐える以外に選択肢はありません。','月はとても悲しいので、鳥は険しい山で泣いています。東に行かないでください。損失があり、新しい仕事を求めるのは楽しいことではありません。私は富を得ましたが、私は半分を得て半分を失います。事前に準備してください。','努力は難しいほど難しくありませんが、どうやってそれをしますか？器用さが得られない場合、あなたは間違いなくあなたの配偶者を失うか戦うでしょう。あなたが器用さをしている場合、あなたの体はあなたの体に侵入するので、明日の健康に注意してください。','仕事が意図したとおりであることは容易ではないので、私の心が悩まされているとは信じられません。歌は一晩の光のタイプで飛んだ、そして私は空だった。  家族は不安で危険なので、祈り、祈るのは良いことです。','努力をspareしみ、激しく挑戦しないでください。近い将来、大きな富を得ることができます。しばらく壊れてお互いに走ることなく、忙しいことをどうやってやるのですか？太い山が落ちるので、未来は良いでしょう。','雲は散らばっており、月は月の側面から突き出ているので、景色は美しく、新しいです。これは、このプールが出会って再び成長するのと同じです。あなたがそれを実行すると、それは利益を得て、何かが良いでしょう。','日付をよくキャプチャして挑戦すると、わずかな富を得ることができます。あなたが受精の近くにいるなら、あなたは歌を恐れているので、あなたの口に注意してください。この王はキム・スークとリー・スークによって与えられます。','2025-03-02 11:57:15.368032+00','j');
